import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

export default function ButtonAppBar() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" style={{ backgroundColor: "rgb(48 195 48)" }}>
        <Toolbar>
          <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', flexGrow: 1 }}>
            <Button color="inherit">Button 1</Button>
            <Button color="inherit">Button 2</Button>
            <Button color="inherit">Button 3</Button>
          </Box>
          <Button color="inherit" href="mainLoginPage">Login</Button>
          <Button color="inherit" href="registerLoginPage">Register</Button>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
